import Gauge from './Gauge.js';
import MainChart from './MainChart.js';
import WordCloud from './WordCloud.js';
import Card from './Card.js';
import './App.css';


function Dashboard({pathos, logos, ethos, subj_score, num_questions, phrases_array}) {
    return (
        <div>
            <div className="App">
                 {/* <TimeLine /> */}
                <h1>HI, {subj_score} {num_questions}</h1>
                <Card number={num_questions}/>
                <MainChart pathosval={pathos} logosval={logos} ethosval={ethos}/>
                <Gauge value={subj_score} min="0" max="1" label='Subjectivity' units="0-1"/>
            </div>
            <div>
                <WordCloud />
            </div>
        </div>
    );
}

export default Dashboard;

